import React from 'react'

export default function reactdomfruit({fruits}) {
const dispalyfruit=()=>
fruits.map(fri=><h2>{fri}</h2>)


  return (
    <div>
        <form>
            <input type='text' value='fruit'/>
            <input type='submit' value='Add fruit'/>
        </form>
        {dispalyfruit()}
    </div>
  )
}
